import './App.css';
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

/* Components */
import Features from './components/Features';
import Contact from './components/Contact';
import AuthPage from './components/AuthPage';
import Menu from './components/Menu';

axios.defaults.xsrfCookieName = 'csrftoken';
axios.defaults.xsrfHeaderName = 'X-CSRFToken';
axios.defaults.withCredentials = true;

const client = axios.create({
  baseURL: "http://127.0.0.1:8000"
});

function App() {
  const [currentUser, setCurrentUser] = useState(false); // Initialize currentUser state

  useEffect(() => {
    client.get("/api/user")
      .then(function(res) {
        setCurrentUser(true); // Set currentUser to true if user is authenticated
      })
      .catch(function(error) {
        setCurrentUser(false); // Set currentUser to false if user is not authenticated
      });
  }, []);

  function submitLogout(e) {
    e.preventDefault();
    client.post("/api/logout", { withCredentials: true })
      .then(function(res) {
        setCurrentUser(false); // Set currentUser to false after logout
      });
  }

  return (
    <Router>
      <div>
        {currentUser ? ( // If user is logged in
          <>
            <Navbar className='navbar-custom'>
              <Container>
                <Navbar.Brand>My Project</Navbar.Brand>
                <Navbar.Toggle />
                <Navbar.Collapse className="justify-content-end">
                  <Navbar.Text>
                    <Button className='logout-button' onClick={submitLogout} variant="light">Log out</Button>
                  </Navbar.Text>
                </Navbar.Collapse>
              </Container>
            </Navbar>
            <div className="button-container">
              <button className="button support">Support</button>
              <button className="button community">Community</button>
              <Link to="/features" className="button features">Features</Link>
              <Link to="/contact" className="button contact-us">Contact Us</Link>
              <button className="button language">English</button>
              <button className="button search-button">
                <FontAwesomeIcon icon={faSearch} />
              </button>
              <button className="button logout" onClick={submitLogout}>Log out</button>
            </div>
            <Menu />
            <div className="home">
              <img src="/media/pexels-googledeepmind-17485633.jpg" alt="Sample" />
            </div>
          </>
        ) : ( // If user is not logged in
          <>
            <Navbar className='navbar-custom'>
              <Container>
                <Navbar.Brand>Main Home Page</Navbar.Brand>
                <Navbar.Toggle />
                <Navbar.Collapse className="justify-content-end">
                  <Navbar.Text>
                    <Link to="/auth" id="form_btn" variant="light">Login</Link>
                    <Link to="/auth" id="form_btn" variant="light">Signup</Link>
                  </Navbar.Text>
                </Navbar.Collapse>
              </Container>
            </Navbar>
            <div className="button-container">
              <button className="button support">Support</button>
              <button className="button community">Community</button>
              <Link to="/features" className="button features">Features</Link>
              <Link to="/contact" className="button contact-us">Contact Us</Link>
              <button className="button language">English</button>
              <button className="button search-button">
                <FontAwesomeIcon icon={faSearch} />
              </button>
            </div>
            <Menu />
          </>
        )}
      </div>

      <Routes>
        <Route path="/auth" element={<AuthPage setCurrentUser={setCurrentUser} />} /> {/* Pass setCurrentUser as a prop */}
        <Route path="/features" element={<Features />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
}

export default App;
